function Navigation() {
  return (
    <nav className="navigation">
      <a href="#sobre">Sobre</a>
      <a href="#serviços">Serviços</a>
      <a href="#resultados">Resultados</a>
      <a href="#contato">Contato</a>
    </nav>
  );
}
export default Navigation;
